PRAGMA foreign_keys=ON;
BEGIN TRANSACTION;

DROP TABLE if exists Booking;
DROP TABLE if exists Trip;
DROP TABLE if exists TourCompany;
DROP TABLE if exists Customer;
DROP TABLE if exists Type;
DROP TABLE if exists Area;

CREATE TABLE TourCompany (
  id INTEGER PRIMARY KEY,
  name varchar(50),
  phone int,
  address varchar(50),
  email varchar(50)
);


CREATE TABLE Area (
  name varchar(50) PRIMARY KEY
);


CREATE TABLE Type (
  name varchar(50) PRIMARY KEY
);


CREATE TABLE Trip (
  id INTEGER PRIMARY KEY,
  name varchar(50),
  date DATE,
  startTime TIME,
  endTime TIME,
  description varchar(200),
  familyFriendly int,
  accessible int,
  price int,
  typeName varchar(50) REFERENCES Type(name),
  area varchar(50) REFERENCES area(name),
  maxTravelers int,
  availablePlaces int,
  tourCompanyId int REFERENCES TourCompany(id)
);




CREATE TABLE Customer (
  id INTEGER PRIMARY KEY,
  name varchar(50),
  phone int,
  address varchar(50),
  email varchar(50)
);

CREATE TABLE Booking (
  id INTEGER PRIMARY KEY,
  customerId int REFERENCES Customer(id),
  tripId int REFERENCES Trip(id),
  numTravelers int,
  hotelPickup int,
  active int
);

COMMIT;
